import React from "react";
import { useNavigate } from "react-router-dom";
const Profile = () => {
  const auth = localStorage.getItem("user");
  const navigate = useNavigate();
  const login = () => {
    navigate("/singup");
  };
  const email = () => {
    navigate("/singup");
  };
  return (
    <div className="profile">
      <div className="profile1">
        <img
          src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.freepik.com%2Ffree-photos-vectors%2Fwellcome&psig=AOvVaw0GXH9iLYz0E-hhSib6GQaa&ust=1701167580313000&source=images&cd=vfe&opi=89978449&ved=0CBIQjRxqFwoTCPiVop7944IDFQAAAAAdAAAAABAE"
          height="100px"
        />
        <h1 onChange={login} to="/singup">
          WELLCOME :
          <img
            src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTrrX4WJY9K43q1L-6IRWB4Ne55jK9QOC75iw&usqp=CAU"
            height="36px"
          />
          :{JSON.parse(auth).name}
        </h1>
        <h1 onChange={login} to="/singup">
          Email :
          <img
            src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTrrX4WJY9K43q1L-6IRWB4Ne55jK9QOC75iw&usqp=CAU"
            height="36px"
          />{" "}
          :{JSON.parse(auth).email}
        </h1>
      </div>
    </div>
  );
};

export default Profile;
